<ul>
    <li>FRatioDistribution[<em>n</em>,<em>m</em>] represents an F-ratio distribution with <em>n</em> numerator and

</ul><p><b>Attributes:</b> Protected, ReadProtected</p><p><b>Symbol has no options.</b></p>
